import React from "react";
import "./footer.css"

import{Container, Row, Col, ListGroup, ListGroupItem} from 'reactstrap'
import {Link} from 'react-router-dom'
import logo from "../../assets/images/logo.jpg"

const company = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/about',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Destination'
    },
]

const contact = [
    {
        path: '/help',
        display: 'Help/FAQ'
    },
    {
        path: '/gallery',
        display: 'Gallery'
    },
    {
        path: '/affilates',
        display: 'Affilates'
    },
]

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg='3'>
                        <div className="logo">
                            <img src={logo} alt=""/>
                            <p>Book your trip in a minute, get fully immerse in to the culture.</p>
                        </div>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
};

export default Footer;
